import { IoStarOutline, IoStar } from 'react-icons/io5';

const StarRating = ({ rating }) => {

  return (
    <div className="star-rating">
      {Array.from({ length: 5 }, (_, i) => (
        <span key={i} className="star">
          {i < rating ? <IoStar/> : <IoStarOutline/>}
        </span>
      ))}
    </div>
  );
};

export default StarRating;
